import{_ as a}from"./chunks/precland-flow-diagram.B2RC2bKg.js";import{_ as r,c as t,a8 as o,o as i}from"./chunks/framework.BDnHobkS.js";const f=JSON.parse('{"title":"Точна посадка","description":"","frontmatter":{},"headers":[],"relativePath":"uk/advanced_features/precland.md","filePath":"uk/advanced_features/precland.md"}'),n={name:"uk/advanced_features/precland.md"};function d(l,e,c,s,h,p){return i(),t("div",null,e[0]||(e[0]=[o(`<h1 id="точна-посадка" tabindex="-1">Точна посадка <a class="header-anchor" href="#точна-посадка" aria-label="Permalink to &quot;Точна посадка&quot;">​</a></h1><p>PX4 підтримує точне приземлення для <em>Multicopters</em> на стаціонарних або рухомих цілях. Ціль може бути надана вбудованим ІЧ-датчиком та приземленням, або зовнішньою системою позиціонування.</p><p>Пристрій для точного приземлення може бути <a href="#initiating-a-precision-landing">запущений/ініційований</a> як частина <a href="#mission">місії</a>, у режимі <a href="#return-mode-precision-landing">повернення</a> на посадку або при вході у режим польоту <a href="#precision-landing-flight-mode"><em>Точна посадка</em></a>.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Точна посадка можлива лише з дійсною глобальною позицією (через обмеження в поточній реалізації контролера позиції).</p></div><h2 id="загальнии-огляд" tabindex="-1">Загальний огляд <a class="header-anchor" href="#загальнии-огляд" aria-label="Permalink to &quot;Загальний огляд&quot;">​</a></h2><h3 id="режими-посадки" tabindex="-1">Режими посадки <a class="header-anchor" href="#режими-посадки" aria-label="Permalink to &quot;Режими посадки&quot;">​</a></h3><p>Точну посадку можна налаштувати як &quot;обов&#39;язкову&quot; або &quot;вигідну&quot;. Вибір режиму впливає на те, як виконується точна посадка.</p><h4 id="необхіднии-режим" tabindex="-1">Необхідний режим <a class="header-anchor" href="#необхіднии-режим" aria-label="Permalink to &quot;Необхідний режим&quot;">​</a></h4><p>У <em>Required Mode</em> транспортний засіб буде шукати ціль, якщо нічого не видно під час початку посадки. Транспортний засіб виконає точну посадку, якщо ціль буде знайдена.</p><p>Процедура пошуку полягає у підйомі на висоту пошуку (<a href="./../advanced_config/parameter_reference.html#PLD_SRCH_ALT">PLD_SRCH_ALT</a>). Якщо мішень все ще не видно на висоті пошуку після закінчення часу пошуку (<a href="./../advanced_config/parameter_reference.html#PLD_SRCH_TOUT">PLD_SRCH_TOUT</a>), то ініціюється звичайна посадка на поточному місці.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Якщо використовується позамежна система позиціонування, PX4 передбачає, що ціль буде видима, коли отримує повідомлення MAVLink <a href="https://mavlink.io/en/messages/common.html#LANDING_TARGET" target="_blank" rel="noreferrer">LANDING_TARGET</a>.</p></div><h4 id="опортуністичнии-режим" tabindex="-1">Опортуністичний режим <a class="header-anchor" href="#опортуністичнии-режим" aria-label="Permalink to &quot;Опортуністичний режим&quot;">​</a></h4><p>У режимі <em>Opportunistic Mode</em> транспортний засіб використовуватиме точну посадку, <em>якщо</em> (і тільки якщо) ціль буде видима, коли розпочинається посадка. Якщо ціль не видно, транспортний засіб негайно виконує <em>звичайну</em> посадку на поточному місці.</p><h3 id="фази-посадки" tabindex="-1">Фази посадки <a class="header-anchor" href="#фази-посадки" aria-label="Permalink to &quot;Фази посадки&quot;">​</a></h3><p>Режим Точної посадки має три етапи:</p><ol><li><p><strong>Горизонтальний підхід:</strong> Транспортний засіб підходить до цілі горизонтально, утримуючи свою поточну висоту. Як тільки положення цілі відносно транспортного засобу опускається нижче порогового значення (<a href="./../advanced_config/parameter_reference.html#PLD_HACC_RAD">PLD_HACC_RAD</a>), відбувається вхід до наступної фази. Якщо ціль втрачається під час цієї фази (не видно довше, ніж <a href="./../advanced_config/parameter_reference.html#PLD_BTOUT">PLD_BTOUT</a>), ініціюється процедура пошуку (під час необхідної точної посадки) або транспортний засіб робить звичайну посадку (під час можливої точної посадки).</p></li><li><p><strong>Спуск над ціль:</strong> Транспортний засіб спускається, залишаючись при цьому над ціллю. Якщо ціль втрачається під час цієї фази (не видно довше, ніж <code>PLD_BTOUT</code>), ініціюється процедура пошуку (під час необхідної точної посадки) або транспортний засіб робить звичайну посадку (під час можливої точної посадки).</p></li><li><p><strong>Останній підхід:</strong> Коли транспортний засіб знаходиться близько до землі (ближче, ніж <a href="./../advanced_config/parameter_reference.html#PLD_FAPPR_ALT">PLD_FAPPR_ALT</a>), він спускається, залишаючись при цьому над ціллю. Якщо ціль втрачається під час цієї фази, спуск продовжується незалежно від виду точної посадки.</p></li></ol><p>Процедури пошуку ініціюються на перших і других етапах і виконуються не більше <a href="./../advanced_config/parameter_reference.html#PLD_MAX_SRCH">PLD_MAX_SRCH разів</a>. Діаграма потоку фаз посадки</p><p>Діаграма потоку, що показує фази, може бути знайдена на <a href="#landing-phases-flow-diagram">діаграмі потоку фаз посадки</a> нижче.</p><h2 id="початок-точноі-посадки" tabindex="-1">Початок точної посадки <a class="header-anchor" href="#початок-точноі-посадки" aria-label="Permalink to &quot;Початок точної посадки&quot;">​</a></h2><p>Точне приземлення можна використовувати у місіях, під час фази посадки у режимі <em>Повернення</em>, або ввійшовши в режим <em>Точна посадка</em>.</p><p><a id="mission"></a></p><h3 id="місія-точна-посадка" tabindex="-1">Місія Точна посадка <a class="header-anchor" href="#місія-точна-посадка" aria-label="Permalink to &quot;Місія Точна посадка&quot;">​</a></h3><p>Точне приземлення може бути запущено як частина <a href="./../flying/missions.html">місії</a>, використовуючи <a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_LAND" target="_blank" rel="noreferrer">MAV_CMD_NAV_LAND</a> з відповідно встановленим <code>param2</code>:</p><ul><li><code>0</code>: нормальне приземлення без використання цілі.</li><li><code>1</code>: <a href="#opportunistic-mode">Opportunistic</a> режим точної посадки.</li><li><code>2</code>: <a href="#required-mode">Required</a> режим точної посадки.</li></ul><h3 id="режим-повернення-з-точною-посадкою" tabindex="-1">Режим повернення з точною посадкою <a class="header-anchor" href="#режим-повернення-з-точною-посадкою" aria-label="Permalink to &quot;Режим повернення з точною посадкою&quot;">​</a></h3><p>Точна посадка може бути використана у фазі посадки у <a href="./../flight_modes/return.html">режимі повернення</a>.</p><p>Це вмикається за допомогою параметра <a href="./../advanced_config/parameter_reference.html#RTL_PLD_MD">RTL_PLD_MD</a>, який приймає такі значення:</p><ul><li><code>0</code>: Точна посадка вимкнена (посадка як зазвичай).</li><li><code>1</code>: <a href="#opportunistic-mode">Опортуничний</a> режим точної посадки.</li><li><code>2</code>: <a href="#required-mode">Вимагається</a> режим точної посадки.</li></ul><h3 id="режим-польоту-з-точною-посадкою" tabindex="-1">Режим польоту з точною посадкою <a class="header-anchor" href="#режим-польоту-з-точною-посадкою" aria-label="Permalink to &quot;Режим польоту з точною посадкою&quot;">​</a></h3><p>Точна посадка може бути ввімкнена, переключившись у режим польоту з <em>точною посадкою</em>.</p><p>Ви можете перевірити це, використовуючи <a href="./../debug/mavlink_shell.html#qgroundcontrol-mavlink-console">консоль MAVLink <em>QGroundControl</em></a> для введення наступної команди:</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">commander</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> mode</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> auto:precland</span></span></code></pre></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p>При переході до режиму таким чином, точна посадка завжди &quot;вимагається&quot;; немає способу вказати тип посадки.</p></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p>На момент написання немає <em>зручного</em> способу безпосередньо викликати точну посадку (окрім командування режимом повернення):</p><ul><li>QGroundControl_ не надає його як параметр користувальницького інтерфейсу.</li><li>Команда <a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_LAND" target="_blank" rel="noreferrer">MAV_CMD_NAV_LAND</a> працює лише в місіях.</li><li>Команда <a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_SET_MODE" target="_blank" rel="noreferrer">MAV_CMD_DO_SET_MODE</a> має працювати, але вам потрібно визначити відповідні базові і користувацькі режими, які використовує PX4 для представлення режиму точної посадки.</li></ul></div><h2 id="налаштування-програмного-забезпечення" tabindex="-1">Налаштування програмного забезпечення <a class="header-anchor" href="#налаштування-програмного-забезпечення" aria-label="Permalink to &quot;Налаштування програмного забезпечення&quot;">​</a></h2><h3 id="налаштування-ir-сенсора-бікона" tabindex="-1">Налаштування IR Сенсора/Бікона <a class="header-anchor" href="#налаштування-ir-сенсора-бікона" aria-label="Permalink to &quot;Налаштування IR Сенсора/Бікона&quot;">​</a></h3><p>Рішення з інфрачервоним датчиком/посадковим маяком потребує датчика <a href="https://irlock.com/products/ir-lock-sensor-precision-landing-kit" target="_blank" rel="noreferrer">IR-LOCK</a> та напрямленого донизу <a href="./../sensor/rangefinders.html">датчика відстані</a>, підключеного до автопілота, а також інфрачервоного маяка в якості цілі (наприклад, <a href="https://irlock.com/collections/markone" target="_blank" rel="noreferrer">IR-LOCK MarkOne</a>). Це дозволяє приземлитися з точністю приблизно 10 см (в той час як точність GPS може бути в декілька метрів).</p><p>Встановіть датчик IR-LOCK, слідуючи <a href="https://irlock.readme.io/v2.0/docs" target="_blank" rel="noreferrer">офіційному посібнику</a>. Переконайтеся, що ось x сенсора вирівняна з осью y транспортного засобу, а ось y сенсора вирівняна з напрямком -x транспортного засобу (це відбувається, якщо камера нахилена вниз на 90 градусів від напрямку вперед).</p><p>Установіть <a href="./../sensor/rangefinders.html">датчик дальності/відстані</a> (виявлено, що <em>LidarLite v3</em> працює добре).</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Багато датчиків дальності на основі інфрачервоного випромінювання погано працюють в присутності маяка IR-LOCK. Зверніться до посібника з IR-LOCK для інших сумісних датчиків.</p></div><h2 id="позабортне-позиціонування" tabindex="-1">Позабортне позиціонування <a class="header-anchor" href="#позабортне-позиціонування" aria-label="Permalink to &quot;Позабортне позиціонування&quot;">​</a></h2><p>Для позабортового рішення потрібна система позиціонування, яка реалізує <a href="https://mavlink.io/en/services/landing_target.html" target="_blank" rel="noreferrer">Landing Target Protocol</a> MAVLink. Це може використовувати будь-який механізм позиціонування для визначення місця посадки, наприклад комп&#39;ютерного зору та візуального маркера.</p><p>Система повинна публікувати координати цілі в повідомленні <a href="https://mavlink.io/en/messages/common.html#LANDING_TARGET" target="_blank" rel="noreferrer">LANDING_TARGET</a>. Зверніть увагу, що PX4 <em>вимагає</em>, щоб <code>LANDING_TARGET.frame</code> був <a href="https://mavlink.io/en/messages/common.html#MAV_FRAME_LOCAL_NED" target="_blank" rel="noreferrer">MAV_FRAME_LOCAL_NED</a> і заповнював лише поля <code>x</code>, <code>y</code>, та <code>z</code>. Початок локальної системи NED [0,0] - це домашня позиція (ви можете відобразити цю домашню позицію на глобальні координати, використовуючи <a href="https://mavlink.io/en/messages/common.html#GPS_GLOBAL_ORIGIN" target="_blank" rel="noreferrer">GPS_GLOBAL_ORIGIN</a>).</p><p>PX4 does not explicitly require a <a href="./../sensor/rangefinders.html">distance sensor</a> or other sensors, but will perform better if it can more precisely determine its own position.</p><h2 id="конфігурація-прошивки" tabindex="-1">Конфігурація прошивки <a class="header-anchor" href="#конфігурація-прошивки" aria-label="Permalink to &quot;Конфігурація прошивки&quot;">​</a></h2><p>Для точної посадки потрібні модулі <code>irlock</code> та <code>landing_target_estimator</code>. Ці модулі включені до прошивки PX4 за замовчуванням для більшості польотних контролерів.</p><p>Вони не включені за замовчуванням на контролерах, що базуються на FMUv2. На цих та інших платах, де вони не включені, ви можете додати їх, встановивши наступні ключі на &#39;y&#39; у відповідному конфігураційному файлі для вашого автопілота (наприклад, як зроблено тут для FMUv5: <a href="https://github.com/PX4/PX4-Autopilot/blob/main/boards/px4/fmu-v5/default.px4board" target="_blank" rel="noreferrer">PX4-Autopilot/boards/px4/fmu-v5/default.px4board</a>):</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>CONFIG_DRIVERS_IRLOCK=y</span></span>
<span class="line"><span>CONFIG_MODULES_LANDING_TARGET_ESTIMATOR=y</span></span></code></pre></div><h2 id="конфігурація-px4-параметри" tabindex="-1">Конфігурація PX4 (параметри) <a class="header-anchor" href="#конфігурація-px4-параметри" aria-label="Permalink to &quot;Конфігурація PX4 (параметри)&quot;">​</a></h2><p>Датчик IR-Lock вимкнено за замовчуванням. Увімкніть його, встановивши <a href="./../advanced_config/parameter_reference.html#SENS_EN_IRLOCK">SENS_EN_IRLOCK</a> на <code>1</code> (true).</p><p><a href="./../advanced_config/parameter_reference.html#LTEST_MODE">LTEST_MODE</a> визначає, чи припускається, що ціль є нерухомою або рухливою. Якщо параметр <code>LTEST_MODE</code> встановлено на значення moving (наприклад, він встановлений на транспортний засіб, на який має сісти багтроплан), вимірювання цілі використовуються лише для генерації цілейових точок позиції в контролері точної посадки. Якщо параметр <code>LTEST_MODE</code> встановлено ​​на значення stationary, вимірювання цілі також використовуються оцінювачем позиції транспортного засобу (EKF2 або LPE).</p><p>Інші важливі параметри перераховані в посиланнях на параметри в референсі параметрів під <a href="./../advanced_config/parameter_reference.html#landing-target-estimator">Landing_target estimator</a> та <a href="./../advanced_config/parameter_reference.html#precision-land">Precision land</a>. Деякі з найбільш корисних перераховані нижче.</p><table tabindex="0"><thead><tr><th>Параметр</th><th>Опис</th></tr></thead><tbody><tr><td><a id="SENS_EN_IRLOCK"></a><a href="./../advanced_config/parameter_reference.html#SENS_EN_IRLOCK">SENS_EN_IRLOCK</a></td><td>IR-LOCK Sensor (зовнішній I2C). Disable: <code>0</code> (default): Enable: <code>1</code>).</td></tr><tr><td><a id="LTEST_MODE"></a><a href="./../advanced_config/parameter_reference.html#LTEST_MODE">LTEST_MODE</a></td><td>Landing target is moving (<code>0</code>) or stationary (<code>1</code>). За замовчуванням - рухома.</td></tr><tr><td><a id="PLD_HACC_RAD"></a><a href="./../advanced_config/parameter_reference.html#PLD_HACC_RAD">PLD_HACC_RAD</a></td><td>Горизонтальний радіус прийняття, всередині якого транспортний засіб почне спускатися. За замовчуванням - 0,2 м.</td></tr><tr><td><a id="PLD_BTOUT"></a><a href="./../advanced_config/parameter_reference.html#PLD_BTOUT">PLD_BTOUT</a></td><td>Таймаут цілі посадки, після якого припускається, що ціль втрачена. За замовчуванням - 5 секунд.</td></tr><tr><td><a id="PLD_FAPPR_ALT"></a><a href="./../advanced_config/parameter_reference.html#PLD_FAPPR_ALT">PLD_FAPPR_ALT</a></td><td>Висота останнього підходу. Висота останнього підходу. За замовчуванням - 0,1 метра.</td></tr><tr><td><a id="PLD_MAX_SRCH"></a><a href="./../advanced_config/parameter_reference.html#PLD_MAX_SRCH">PLD_MAX_SRCH</a></td><td>Максимальна кількість спроб пошуку у вимаганій посадці.</td></tr><tr><td><a id="RTL_PLD_MD"></a><a href="./../advanced_config/parameter_reference.html#RTL_PLD_MD">RTL_PLD_MD</a></td><td>Режим точної посадки RTL. <code>0</code>: disabled, <code>1</code>: <a href="#opportunistic-mode">Opportunistic</a>, <code>2</code>: <a href="#required-mode">Required</a>.</td></tr></tbody></table><h3 id="масштабування-іч-маяка" tabindex="-1">Масштабування ІЧ-маяка <a class="header-anchor" href="#масштабування-іч-маяка" aria-label="Permalink to &quot;Масштабування ІЧ-маяка&quot;">​</a></h3><p>Масштабування вимірювань може бути необхідним через спотворення об&#39;єктива датчика IR-LOCK.</p><p><a href="./../advanced_config/parameter_reference.html#LTEST_SCALE_X">LTEST_SCALE_X</a> та <a href="./../advanced_config/parameter_reference.html#LTEST_SCALE_Y">LTEST_SCALE_Y</a> можуть бути використані для масштабування вимірів маяка, перед тим як вони будуть використані для оцінки позиції та швидкості маяка відносно транспортного засобу. Зверніть увагу, що <code>LTEST_SCALE_X</code> та <code>LTEST_SCALE_Y</code> вважаються в рамках датчика, а не в рамках транспортного засобу.</p><p>Щоб калібрувати ці параметри масштабу, встановіть <code>LTEST_MODE</code> на значення moving, підніміть свій багатокоптер вище за маяк і виконайте рухи вперед-назад та ліворуч-праворуч з транспортним засобом, під час цього <a href="./../dev_log/logging.html#configuration">записуючи</a> дані з <code>landing_target_pose</code> та <code>vehicle_local_position</code>. Потім порівняйте <code>landing_target_pose.vx_rel</code> та <code>landing_target_pose.vy_rel</code> з <code>vehicle_local_position.vx</code> та <code>vehicle_local_position.vy</code> відповідно (обидва виміри у системі координат NED). Якщо оцінювані швидкості маяка завжди менші або більші за швидкості транспортного засобу, налаштуйте параметри масштабування для компенсації.</p><p>Якщо ви спостерігаєте повільні бокові коливання літального апарата під час точної посадки з параметром <code>LTEST_MODE</code>, встановленим на стаціонарний, ймовірно, вимірювання маяка занадто високі, і вам слід зменшити параметр масштабування у відповідному напрямку.</p><h2 id="симуляція" tabindex="-1">Симуляція <a class="header-anchor" href="#симуляція" aria-label="Permalink to &quot;Симуляція&quot;">​</a></h2><p>Точне приземлення з датчиком IR-LOCK та маяком може бути симульоване в <a href="./../sim_gazebo_classic/README.html">Gazebo Classic</a>.</p><p>Щоб запустити симуляцію зі світом, що містить маяк IR-LOCK та транспортний засіб із датчиком дальності та камерою IR-LOCK, виконайте наступну команду:</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">make</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> px4_sitl</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> gazebo-classic_iris_irlock</span></span></code></pre></div><p>Ви можете змінити розташування маяка або перемістивши її в Gazebo Classic GUI або змінивши її місце в <a href="https://github.com/PX4/PX4-SITL_gazebo-classic/blob/main/worlds/iris_irlock.world#L42" target="_blank" rel="noreferrer">Gazebo World</a>.</p><h2 id="принцип-діі" tabindex="-1">Принцип дії <a class="header-anchor" href="#принцип-діі" aria-label="Permalink to &quot;Принцип дії&quot;">​</a></h2><h3 id="оцінювач-цілеи-посадки" tabindex="-1">Оцінювач цілей посадки <a class="header-anchor" href="#оцінювач-цілеи-посадки" aria-label="Permalink to &quot;Оцінювач цілей посадки&quot;">​</a></h3><p><code>landing_target_estimator</code> бере вимірювання з драйвера irlock, а також оцінює висоту місцевості для оцінки позиції маяка відносно транспортного засобу.</p><p>The measurements in <code>irlock_report</code> містять тангенс кутів від центру зображення до маяка. Іншими словами, вимірювання - це компоненти x та y вектора, що вказує на маяк, де компонент z має довжину &quot;1&quot;. Це означає, що масштабування вимірювання за відстанню від камери до маяка призводить до вектора від камери до маяка. Ця відносна позиція потім повертається у зіставлений з півночі, рівномірний корпусний каркас за допомогою оцінки польоту засобами повітряного судна. Обидва компоненти x та y відносного вимірювання позиції фільтруються в окремих фільтрах Калмана, які діють як прості фільтри згладжування з низькою пропускною спроможністю, що також генерують оцінку швидкості та дозволяють відкидати викиди.</p><p><code>landing_target_estimator</code> публікує приблизну відносну позицію і швидкість щоразу, коли новий звіт про <code>irlock_report</code> об&#39;єднується в оцінку. Нічого не публікується, якщо маяк не бачиться або вимірювання маяка відхиляються. Оцінка посадкової цілі публікується в повідомленні uORB <code>landing_target_pose</code>.</p><h3 id="покращена-оцінка-положення-транспортного-засобу" tabindex="-1">Покращена оцінка положення транспортного засобу <a class="header-anchor" href="#покращена-оцінка-положення-транспортного-засобу" aria-label="Permalink to &quot;Покращена оцінка положення транспортного засобу&quot;">​</a></h3><p>Якщо ціль вказана як стаціонарна за допомогою параметра <code>LTEST_MODE</code>, оцінку положення/швидкості транспортного засобу можна покращити за допомогою вимірів цілі. Це виконується шляхом злиття швидкості цілі як вимірювання від&#39;ємної швидкості транспортного засобу.</p><h3 id="діаграма-потоку-фаз-посадки" tabindex="-1">Діаграма потоку фаз посадки <a class="header-anchor" href="#діаграма-потоку-фаз-посадки" aria-label="Permalink to &quot;Діаграма потоку фаз посадки&quot;">​</a></h3><p>Це зображення показує <a href="#landing-phases">фази посадки</a> у вигляді діаграми потоку.</p><p><img src="`+a+'" alt="Precision Landing Flow Diagram"></p>',73)]))}const u=r(n,[["render",d]]);export{f as __pageData,u as default};
